- input: "TEXT\x1CC00253153\x1C18725482\x1C\x1CF3XA\x1CThis report is being amended
    on 11/10/2010 in response to FEC letter C00253153 dated 11/1/2010.  It was noted
    that on the August monthly report, lines 11(a)(i) and 11(a)(ii) column B figures
    were not totaling correctly.  This error was caused because we discovered many
    duplicate contribution records in May 2010.  In an effort to correct the records,
    we merged duplicate records into a single record per individual over the course
    of July and August.  We did not realize the effect it would have on past reporting
    of itemized and unitemized records for Line 11 column B of the reporting.  I will
    be amending reports covering the periods of February 1 to July 31, 2010. A total
    of 6 past reports including the specific report noted on the FEC letter C00253153
    referencing the August Monthly Report (7/1/2010-7/31/2010).  All reports post
    7/31/2010 remain the same and are correct as previously reported.  After these
    6 reports are amended, the B Column will roll correctly from month to month for
    the entire year of 2010. If you have any questions, please feel free to contact
    Todd Tanck at (813) 282-1225 Ext 1156 or by email at ToddTanck@Outback.com\n"
